-- Clear script output screen.  
clear screen;

-----------------DROP section
drop table Enrollment;
drop table Section;
drop table Room;
drop table Teacher;
drop table Major_Student_Linking;
drop table Course;
drop table major;
drop table student;
drop table address;
drop table student_address_linking;

DROP sequence address_id_seq;
DROP sequence COURSE_id_seq;
DROP sequence ROOM_id_seq;
DROP sequence SECTION_id_seq ;

--Turn off substitution variable capture
Set Define off;

--create sequences
create sequence address_id_seq start with 223;
CREATE sequence COURSE_id_seq  start with 61;
CREATE sequence ROOM_id_seq start with 38;
CREATE sequence SECTION_id_seq;


-----------------CREATE section
CREATE TABLE Address (
  Address_ID        NUMBER  	    default address_id_seq.nextval      PRIMARY KEY,
  Address_Line_1    VARCHAR(50)	    NOT NULL,
  Address_Line_2    VARCHAR(50)	    NULL,
  City              VARCHAR(50)     NOT NULL,
  State_Region      VARCHAR(50)     NOT NULL,
  Zip_Postal_Code   VARCHAR(10)     NOT NULL,
  Country           VARCHAR(50)     NOT NULL
);

CREATE TABLE Student (
  UTEID                 VARCHAR(10)     PRIMARY KEY,
  First_Name            VARCHAR(50)	    NOT NULL,
  Middle_Name           VARCHAR(20) 	NULL,
  Last_Name             VARCHAR(50)	    NOT NULL,
  Date_of_birth         DATE		    NOT NULL,
  Classification        CHAR(1)		    NOT NULL,
  Email                 VARCHAR(50)	    NOT NULL    UNIQUE,
  Phone                 CHAR(12)	    NOT NULL,
  Primary_College_Code  CHAR(1)		    NOT NULL,
  International_Flag    CHAR(1)		    NOT NULL,
  cGPA                  NUMBER(3,2)	    NULL,
  CONSTRAINT Int_Flag_CHECK CHECK (International_Flag IN ('Y', 'N')),
  CONSTRAINT CLASS_CHECK    CHECK (Classification IN ('1','2','3','4','G','P','C')),
  CONSTRAINT Student_Email_Length_Check CHECK (LENGTH(Email) >= 7)
);

CREATE TABLE student_address_linking (
    UTEID               VARCHAR(10),
    Address_ID          NUMBER,
    Address_Type_Code   CHAR(1), 
    constraint address_type_check CHECK (Address_Type_Code in ('H','L','O')),
    PRIMARY KEY (UTEID, Address_ID, Address_Type_Code)
);

 
CREATE TABLE Major (
  Major_ID              NUMBER      PRIMARY KEY,
  Major_Code            CHAR(3)     NOT NULL    UNIQUE,
  Major_Description     VARCHAR(50) NOT NULL
);

CREATE TABLE Course (
  Course_ID             NUMBER         default COURSE_id_seq.nextval      PRIMARY KEY,
  course_code           VARCHAR(10)     NOT NULL,
  Course_Name           VARCHAR(50)     NOT NULL,
  Course_Description    VARCHAR(999)    NOT NULL
);

CREATE TABLE Major_Student_Linking (
  UTEID          	VARCHAR(10) REFERENCES Student(UTEID),
  Major_ID       	NUMBER      REFERENCES Major(Major_ID),
  DATE_DECLARED  	DATE        default sysdate,
  PRIMARY KEY (UTEID, Major_ID)  
);

CREATE TABLE Teacher (
  UTEID         	VARCHAR(10)     PRIMARY KEY,
  First_Name     	VARCHAR(50)     NOT NULL,
  Last_Name     	VARCHAR(50)     NOT NULL,
  Email         	VARCHAR(50)     NOT NULL    UNIQUE,
  Primary_Dept  	VARCHAR(4)      NOT NULL,
  Primary_Title 	VARCHAR(50)     NOT NULL,
  Office_Phone  	CHAR(12)        NOT NULL,
  Office_Location   	VARCHAR(12)     NOT NULL,
  Office_Address_1  	VARCHAR(50)     NOT NULL,
  Office_Address_2  	VARCHAR(50)     NULL,
  Office_City       	VARCHAR(50)     NOT NULL,
  Office_State      	CHAR(2)         NOT NULL,
  Office_Zip        	CHAR(5)         NOT NULL,
  Campus_Mail_Code  	CHAR(5)         NOT NULL
);



CREATE TABLE Room (
  Room_ID           NUMBER  	default ROOM_id_seq.nextval      PRIMARY KEY,
  Building_Code     CHAR(3)     NOT NULL,
  Floor             NUMBER      NOT NULL,
  Room_Number       VARCHAR(8)  NOT NULL,
  Max_Seats         NUMBER(4)   NOT NULL 
);


CREATE TABLE Section (
  Section_ID        NUMBER       default SECTION_id_seq.nextval      PRIMARY KEY,
  Course_ID         NUMBER       NOT NULL   REFERENCES Course(Course_ID),
  Instructor_UTEID  VARCHAR(10)  NULL       REFERENCES Teacher(UTEID),
  Room_ID           NUMBER       NULL       REFERENCES Room(Room_ID),
  Unique_Number     NUMBER       NOT NULL,
  Semester_Code     CHAR(4)      NOT NULL,
  Section_Day       VARCHAR(3)   NULL,
  Section_Hour      NUMBER(4)    NULL,
  Length_Minutes    NUMBER       NULL,
  Section_Mode      CHAR(1)      NOT NULL,
  Seat_Limit        NUMBER       NOT NULL,
  Status            CHAR(1)      default 'O'   NOT NULL,
  CONSTRAINT check_status CHECK (status in ('O','W','C','X')),
  CONSTRAINT UniqueNbr_semester_unique_constraint UNIQUE (UNIQUE_NUMBER, SEMESTER_CODE)
);


CREATE TABLE Enrollment (
  UTEID         VARCHAR(10)  NOT NULL   REFERENCES Student(UTEID),
  Section_ID    NUMBER       NOT NULL   REFERENCES Section(Section_ID) ,
  Grade_Code    VARCHAR(2)   NULL,
  PRIMARY KEY (UTEID, Section_ID),
  CONSTRAINT grade_code_check CHECK (Grade_Code in ('A','A-','B+','B','B-','C+','C','C-','D+','D','D-','F','P','W','Q','X'))
);



